import React from 'react';
import './App.css';
import { Table } from 'react-bootstrap';

// class StockTable extends React.Component {
//
// }

class App extends React.Component {

  constructor(props) {
    super(props);
    this.state = {
      tickers: [],
      pe_ratios: [],
    }
  }

  async componentDidMount() {
    console.log("in componentDidMount")
    const response = await fetch(`http://127.0.0.1:8000/stocks/pe_ratios/`);
    const json = await response.json();
    this.setState({tickers: json["tickers"], pe_ratios: json["pe_ratios"]})
  }

  render() {
    console.log("tickers = ", this.state.tickers);
    console.log("pe_ratios = ", this.state.pe_ratios);
    const len = this.state.tickers.length
    return (
        <Table striped bordered hover variant="dark">
          <thead>
          <tr>
            <th>Ticker</th>
            <th>PE Ratio</th>
          </tr>
          </thead>
          <tbody>
          <tr>
            <td>1</td>
            <td>Mark</td>
          </tr>
          <tr>
            <td>2</td>
            <td>Jacob</td>
          </tr>
          <tr>
            <td>3</td>
            <td>@twitter</td>
          </tr>
          </tbody>
        </Table>
    )
  }
}

export default App;
